import Vue from 'vue';
import Router from 'vue-router';
import home from './components/tabbar/home.vue';
import login from './components/login/login.vue';
import list from './components/goods/list.vue';
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    redirect: "/home"
  }, {
    path: '/home',
    component: home
  }, {
    path: '/login',
    component: login
  }, {
    path: '/list',
    component: list
  }]
});
